    _initStage_light: function (img, centerPos) {
        var self = this;
        var texture2d = self._texture2d = new cc.Texture2D();
        texture2d.initWithElement(img);
        texture2d.handleLoadedTexture();

        for (var i = 0; i < 6; ++i) {
            var logo = new cc.Sprite(texture2d);
            logo.setScale(cc.contentScaleFactor());
            logo.x = centerPos.x + 45 + 20 * i;
            logo.y = centerPos.y - 180;
            self._bgLayer.addChild(logo, 10);
            logo.setOpacity(0);

            var dt1 = cc.delayTime(i * 0.2);
            var fo1 = cc.fadeIn(0.1);

            var dt2 = cc.delayTime(1.2 - i * 0.2);
            var fo2 = cc.fadeOut(0.1);

            logo.runAction(cc.repeatForever(cc.sequence(dt1, fo1, dt2, fo2)));
        }
    },

